import {GET_DETAILS} from './types';
import httpClient from '../../components/util/httpClient';
import notify from '../../components/util/notify';

export const fetchDetails_ac = () => dispatch => {
    console.log('Actions in fecth details');
    httpClient.GET('/details', false)
        .then((response) => {
            console.log('delay at actions to reducer');
            dispatch({
                type: GET_DETAILS,
                payload: response.data
            })
        })
        .catch((err)=> {
            notify.handleError(err);
        })
}
